const Select = ({ value, onSelect }) => (
  <select
    className="custom-select d-inline-block"
    value={value}
    onChange={onSelect}
  >
    <option value="USD">USD</option>
    <option value="GBP">GBP</option>
    <option value="EUR">EUR</option>
  </select>
);

export default Select;
